        private void btnOk_Click(object sender, System.EventArgs e)
        {
            try
            {
                //Added by Atul on  06-10-2010
                decimal DiscountA, DiscountB, DiscountC, DiscountD, DiscountE;

                DiscountA = DiscountB = DiscountC = DiscountD = DiscountE = 0;

                decimal.TryParse(Convert.ToString(dtGridDisCount[1, 0].Value), out DiscountA);
                decimal.TryParse(Convert.ToString(dtGridDisCount[1, 1].Value), out DiscountB);
                decimal.TryParse(Convert.ToString(dtGridDisCount[1, 2].Value), out DiscountC);
                decimal.TryParse(Convert.ToString(dtGridDisCount[1, 3].Value), out DiscountD);
                decimal.TryParse(Convert.ToString(dtGridDisCount[1, 4].Value), out DiscountE);

                Prefrences pre = new Prefrences();
                pre.UpdateKeyDiscount(Configuration.StationID, DiscountA, DiscountB, DiscountC, DiscountD, DiscountE);

                //Added By SRT(Gaurav) Date : 18-Jun-2009
                if (!ValidateAutoPOVendors())
                {
                    clsUIHelper.ShowErrorMsg("Please select minimum one AutoPO Option.");
                    return;
                }
                //PrimePOS-2491 
                if (this.cmbPmtProcessor.Text.Equals(clsPOSDBConstants.EdgeExpressCloud) && string.IsNullOrWhiteSpace(txtPPSubID.Text))
                {
                    MessageBox.Show("Please provide TerminalID for 'EDGEEXPRESS CLOUD' payment processor at Transaction Settings.");
                    return;
                }
                if (this.cmbPmtProcessor.Text.Equals(clsPOSDBConstants.EVERTEC) && string.IsNullOrWhiteSpace(txtPPSubID.Text))//PRIMEPOS-2664
                {
                    MessageBox.Show("Please provide TerminalID for 'EVERTEC' payment processor at Transaction Settings.");
                    return;
                }
                //END

                #region S3 Setting Added By Arvind - Solutran - PRIMEPOS-2663
                if (this.chkS3enbale.Checked && txtS3url.Text.Trim() == string.Empty)
                {
                    clsUIHelper.ShowErrorMsg("Please enter valid  Url.");
                    return;
                }
                if (this.chkS3enbale.Checked && txtS3key.Text.Trim() == string.Empty)
                {
                    clsUIHelper.ShowErrorMsg("Please enter valid Key.");
                    return;
                }

                if (this.chkS3enbale.Checked && txtS3Merchant.Text.Trim() == string.Empty)
                {
                    clsUIHelper.ShowErrorMsg("Please enter S3 Merchant Number.");
                    return;
                }
                #endregion

                UpdateAutoPOOptions();

                //End Of Added By SRT(Gaurav)

                Prefrences oPref = new Prefrences();
                int MoveToQtyCol, AllowAddItem, showNumPad, showItemPad;
                if (this.chkMoveToQtyCol.Checked == true)
                    MoveToQtyCol = 1;
                else
                    MoveToQtyCol = 0;
                if (this.chkAllowAddItem.Checked == true)
                    AllowAddItem = 1;
                else
                    AllowAddItem = 0;

                if (this.chkNumPad.Checked == true)
                    showNumPad = 1;
                else
                    showNumPad = 0;

                if (this.chkItemPad.Checked == true)
                    showItemPad = 1;
                else
                    showItemPad = 0;

                //if (this.chkAllowPicked.Checked == true)
                //    oPOSSet.AllowRxPicked = true;
                //else
                //    oPOSSet.AllowRxPicked = false;
                #region PRIMEPOS-2865 16-Jul-2020 JY Added
                if (cmbMarkRxs.SelectedIndex != -1)
                    oPOSSet.AllowRxPicked = cmbMarkRxs.SelectedIndex;
                else
                    oPOSSet.AllowRxPicked = 1;
                #endregion

                if ((this.txtOutgoingEmailID.Text.Trim().Length > 0 || this.chkUseEmailInvoice.Checked) && !RgxValidateEmailID.IsMatch(this.txtOutgoingEmailID.Text.Trim()))
                {
                    clsUIHelper.ShowErrorMsg("Please enter valid Email ID in Email Setting.");
                    return;
                }

                #region Sprint-24 - PRIMEPOS-2363 28-Dec-2016 JY Added
                if (this.txtOwnersEmailId.Text.Trim() == string.Empty && (chkAutoEmailStationCloseReport.Checked == true || chkAutoEmailEODReport.Checked == true))
                {
                    clsUIHelper.ShowErrorMsg("Please enter valid Managers Email ID in Email Setting.");
                    return;
                }
                else if (this.txtOwnersEmailId.Text.Trim() != string.Empty)
                {
                    string words = txtOwnersEmailId.Text;
                    string[] split = words.Split(new Char[] { ',', ';' });
                    foreach (string emailString in split)
                    {
                        if (!Regex.IsMatch(emailString, @"\A(?:[a-z0-9!#$%&'*+/=?^_`{|}~-]+(?:\.[a-z0-9!#$%&'*+/=?^_`{|}~-]+)*@(?:[a-z0-9](?:[a-z0-9-]*[a-z0-9])?\.)+[a-z0-9](?:[a-z0-9-]*[a-z0-9])?)\Z"))
                        {
                            clsUIHelper.ShowErrorMsg("Please enter valid Managers Email ID in Email Setting.");
                            return;

                        }
                    }
                }
                #endregion

                setCompanyInfo();
                setDeviceSettings();
                SetPrimeEDISettings();  //PRIMEPOS-3167 07-Nov-2022 JY Added
                setSettingDetail();//PRIMEPOS-2739 ADDED BY ARVIND

                setCustomerLoyaltyObject();
                if (oCustomerLoyaltyInfo.UseCustomerLoyalty == true && oCustomerLoyaltyInfo.RedeemValue == 0)
                {
                    clsUIHelper.ShowErrorMsg("Please enter valid " + lblCLRedeemValue.Text + ".");
                    return;
                }


                MerchantConfig oMerchantConfig = setMerchantConfigObject();    //PRIMEPOS-2227 05-May-2017 JY Added

                //Add AllowRx POS parameter by Atul on 02-10-2010
                oPref.UpdatePreferences(ColorToRGB(this.CPWinBackColor.Color), ColorToRGB(this.CPWinForeColor.Color), ColorToRGB(this.CPBtnBackColor1.Color), ColorToRGB(this.CPBtnBackColor2.Color), ColorToRGB(this.CPBtnForeColor.Color), AllowAddItem, MoveToQtyCol, ColorToRGB(this.CPActBackColor.Color), ColorToRGB(this.CPActForeColor.Color), ColorToRGB(this.CPHeaderBackColor.Color), ColorToRGB(this.CPHeaderForeColor.Color), oPOSSet, showNumPad, showItemPad, oCInfo, oSetting, oItemData, oCustomerLoyaltyInfo, oMerchantConfig, bEditMerchantConfig, dtPayTypeReceipts, cboColorScheme.Text, oPrimeEDISetting);   //PRIMEPOS-2227 05-May-2017 JY Added  //PRIMEPOS-2308 16-May-2018 JY Added //PrimePOS-2523 Added cboColorScheme.Text parameter by Farman Ansari on 06-June-2018//PRIMEPOS-2739 ADDED BY ARVIND OSETTING  //PRIMEPOS-3167 07-Nov-2022 JY Added oPrimeEDISetting

                #region 05-Jan-2018 JY Commented
                //Configuration.Window_Color = ColorToRGB(this.CPWinBackColor.Color);
                //Configuration.Window_ForeColor = ColorToRGB(this.CPWinForeColor.Color);
                //Configuration.Window_Button_Color1 = ColorToRGB(this.CPBtnBackColor1.Color);
                //Configuration.Window_Button_Color2 = ColorToRGB(this.CPBtnBackColor2.Color);
                //Configuration.Window_Button_ForeColor = ColorToRGB(this.CPBtnForeColor.Color);
                //Configuration.Active_BackColor = ColorToRGB(this.CPActBackColor.Color);
                //Configuration.Active_ForeColor = ColorToRGB(this.CPActForeColor.Color);

                //Configuration.Header_BackColor = ColorToRGB(this.CPHeaderBackColor.Color);
                //Configuration.Header_ForeColor = ColorToRGB(this.CPHeaderForeColor.Color);
                #endregion

                Configuration.AllowAddItemInTrans = this.chkAllowAddItem.Checked;
                Configuration.moveToQtyCol = this.chkMoveToQtyCol.Checked;

                Configuration.showItemPad = this.chkItemPad.Checked;
                Configuration.showNumPad = this.chkNumPad.Checked;

                Configuration.CSetting = oSetting;//PRIMEPOS-2739 

                Configuration.CPOSSet = oPOSSet;
                Configuration.CInfo = oCInfo;
                Configuration.CLoyaltyInfo = oCustomerLoyaltyInfo;
                //Configuration.objMerchantConfig = oMerchantConfig;  //PRIMEPOS-2227 05-May-2017 JY Added
                WriteChanges();
                clsUIHelper.setColorSchecme(frmMain.getInstance());

                frmMain.getInstance().InstallActivityMonitor();
                Configuration.GetUserSettings(Configuration.UserName);//Added By shitaljit to get the changed seting affected immediately after saving the data.
                clsReports.SetCurrencySymbol();
                this.Close();
            }
            catch (Exception exp)
            {
                clsUIHelper.ShowErrorMsg(exp.Message);
            }
        }
        private void WriteChanges()
        {
            string settingChanges = "Current User :" + Configuration.UserName + " Station ID :" + Configuration.StationID + Environment.NewLine + " Preference Setting change ";
            {
                if (Configuration.Window_Color != ColorToRGB(this.CPWinBackColor.Color))
                {
                    settingChanges += " 'Configuration.Window_Color:'  Old Value  " + Configuration.convertNullToString(Configuration.Window_Color.ToString()) + " New Value " + Configuration.convertNullToString(this.CPWinBackColor.Color.ToString()) + Environment.NewLine;
                }

                if (Configuration.Window_Button_Color1 != ColorToRGB(this.CPBtnBackColor1.Color))
                {

                    settingChanges += " 'Window_Button_Color1:'  Old Value  " + Configuration.convertNullToString(Configuration.Window_Button_Color1.ToString()) + " New Value " + Configuration.convertNullToString(this.CPBtnBackColor1.Color.ToString()) + Environment.NewLine;
                }
                if (Configuration.Window_Button_Color2 != ColorToRGB(this.CPBtnBackColor2.Color))
                {
                    settingChanges += " 'Window_Button_Color2:'  Old Value  " + Configuration.convertNullToString(Configuration.Window_Button_Color2.ToString()) + " New Value " + Configuration.convertNullToString(this.CPBtnBackColor2.Color.ToString()) + Environment.NewLine;
                }
                if (Configuration.Window_Button_ForeColor != ColorToRGB(this.CPBtnForeColor.Color))
                {
                    settingChanges += " 'Window_Button_ForeColor:'  Old Value  " + Configuration.convertNullToString(Configuration.Window_Button_ForeColor.ToString()) + " New Value " + Configuration.convertNullToString(this.CPBtnForeColor.Color.ToString()) + Environment.NewLine;
                }
                if (Configuration.Active_BackColor != ColorToRGB(this.CPActBackColor.Color))
                {
                    settingChanges += " 'Active_BackColor:'  Old Value  " + Configuration.convertNullToString(Configuration.Active_BackColor.ToString()) + " New Value " + Configuration.convertNullToString(this.CPActBackColor.Color.ToString()) + Environment.NewLine;
                }

                if (Configuration.Active_ForeColor != ColorToRGB(this.CPActForeColor.Color))
                {
                    settingChanges += " 'Active_ForeColor:'  Old Value  " + Configuration.convertNullToString(Configuration.Active_ForeColor.ToString()) + " New Value " + Configuration.convertNullToString(this.CPActForeColor.Color.ToString()) + Environment.NewLine;
