                if (Configuration.Header_BackColor != ColorToRGB(this.CPHeaderBackColor.Color))
                {
                    settingChanges += " 'Header_BackColor:'  Old Value  " + Configuration.convertNullToString(Configuration.Header_BackColor.ToString()) + " New Value " + Configuration.convertNullToString(this.CPHeaderBackColor.Color.ToString()) + Environment.NewLine;
                }
                if (Configuration.Header_ForeColor != ColorToRGB(this.CPHeaderForeColor.Color))
                {
                    settingChanges += " 'Header_ForeColor:'  Old Value  " + Configuration.convertNullToString(Configuration.Header_ForeColor.ToString()) + " New Value " + Configuration.convertNullToString(this.CPHeaderForeColor.Color.ToString()) + Environment.NewLine;
                }

                if (Configuration.AllowAddItemInTrans != this.chkAllowAddItem.Checked)
                {
                    settingChanges += " 'AllowAddItemInTrans:'  Old Value  " + Configuration.convertNullToString(Configuration.AllowAddItemInTrans.ToString()) + " New Value " + Configuration.convertNullToString(this.chkAllowAddItem.Checked.ToString()) + Environment.NewLine;
                }
                if (Configuration.moveToQtyCol != this.chkMoveToQtyCol.Checked)
                {
                    settingChanges += " 'moveToQtyCol:'  Old Value  " + Configuration.convertNullToString(Configuration.moveToQtyCol.ToString()) + " New Value " + Configuration.convertNullToString(this.chkMoveToQtyCol.Checked.ToString()) + Environment.NewLine;
                }
                if (Configuration.showItemPad != this.chkItemPad.Checked)
                {
                    settingChanges += " 'showItemPad:'  Old Value  " + Configuration.convertNullToString(Configuration.showItemPad.ToString()) + " New Value " + Configuration.convertNullToString(this.chkItemPad.Checked.ToString()) + Environment.NewLine;
                }
                if (Configuration.showNumPad != this.chkNumPad.Checked)
                {
                    settingChanges += " 'showNumPad:'  Old Value  " + Configuration.convertNullToString(Configuration.showNumPad.ToString()) + " New Value " + Configuration.convertNullToString(this.chkNumPad.Checked.ToString()) + Environment.NewLine;
                }

                settingChanges += PropertiesEqual(oOldCInfo, oCInfo);
                settingChanges += PropertiesEqual(oOldCustomerLoyaltyInfo, oCustomerLoyaltyInfo);
