        #region PRIMEPOS-Consent SAJID DHUKKA - PRIMEPOS-2866
        private void PopulateConsentSource()
        {
            try
            {
                if (Configuration.CPOSSet.UsePrimeRX)   //PRIMEPOS-3106 22-Jun-2022 JY Added if condition
                {
                    PharmData.PharmBL pharmBL = new PharmData.PharmBL();
                    DataTable dt = new DataTable();
                    dt = pharmBL.PopulateConsentSource();
                    string lblConsentName = string.Empty;
                    foreach (DataRow row in dt.Rows)
                    {
                        //this.cmbConsent.Items.Add(row["ID"].ToString(), row["Name"].ToString());
                        lblConsentName = string.Concat(lblConsentName, row["Name"].ToString(), " ,");
                        if (oCInfo.ConsentSourceActiveList == null)
                        {
                            oCInfo.ConsentSourceActiveList = new Dictionary<int, string>();
                        }
                        if (!oCInfo.ConsentSourceActiveList.ContainsKey(int.Parse(row["ID"].ToString())))
                        {
                            oCInfo.ConsentSourceActiveList.Add(int.Parse(row["ID"].ToString()), row["Name"].ToString());
                        }
                    }
                    lblConsentSources.Text = lblConsentName.TrimEnd(',');
                }
                else
                {
                    lblConsentSources.Text = "";
                }
            }
            catch (Exception ex)
            {
                if (Configuration.CPOSSet.UsePrimeRX)   //PRIMEPOS-3106 22-Jun-2022 JY Added if condition
                    clsUIHelper.ShowErrorMsg(ex.ToString());
            }
        }

        #endregion
        //Added By SRT(Prashant) On Date: 7/05/2009
        private void FillVendors()
        {
            POS_Core.BusinessRules.Vendor vendor = null;
            VendorData vendorData = null;
            try
            {
                vendor = new POS_Core.BusinessRules.Vendor();
                vendorData = vendor.PopulateList("");

                if (vendorData.Tables.Count > 0 && vendorData.Tables[0].Rows.Count > 0)
                {
                    //Added by Abhishek(SRT) -- 07/09/2009
                    //Added to sort the data by vendor
                    DataRow[] vendorRows = vendorData.Tables[0].Select("", "VendorCode ASC");
                    //End of Added by Abhishek(SRT)

                    foreach (DataRow vendorRow in vendorRows)
                    {
                        this.ultraCmbDefaultVendors.Items.Add(vendorRow["VendorID"].ToString(), vendorRow["VendorCode"].ToString());
                    }
                }
            }
            catch (Exception ex)
            {
                clsUIHelper.ShowErrorMsg(ex.ToString());
            }
        }

