        public string PropertiesEqual(object OldOBJ, object NewOBJ)
        {
            string changesetting = "";
            Type sourceType = OldOBJ.GetType();
            Type destinationType = NewOBJ.GetType();
            try
            {


                if (sourceType == destinationType)
                {
                    //[] sourceProperties = 
                    FieldInfo[] sourceProperties = sourceType.GetFields();
                    foreach (FieldInfo pi in sourceProperties)
                    {
                        string Newss = "";
                        string Oldss = "";
                        if (pi.GetValue(OldOBJ) != null)
                        {
                            Oldss = pi.GetValue(OldOBJ).ToString();

                            if (pi.GetValue(NewOBJ) != null)
                            {
                                Newss = pi.GetValue(NewOBJ).ToString();

                                decimal temp;
                                if (decimal.TryParse(Newss, out temp) && decimal.TryParse(Oldss, out temp) && Configuration.convertNullToDecimal(Newss) == Configuration.convertNullToDecimal(Oldss))
                                {
                                    continue;
                                }
                            }
                        }
                        if ((pi.GetValue(NewOBJ) == null && pi.GetValue(OldOBJ) == null) || (pi.GetValue(OldOBJ).ToString() == "" && pi.GetValue(NewOBJ).ToString() == ""))
                        {

                        }
                        else if ((pi.GetValue(OldOBJ) == null && pi.GetValue(NewOBJ) != null) || (pi.GetValue(NewOBJ) == null && pi.GetValue(OldOBJ) != null))
                        {
                            changesetting += "" + pi.Name + " Old Value  " + Configuration.convertNullToString(pi.GetValue(OldOBJ)) + " New Value " + Configuration.convertNullToString(pi.GetValue(NewOBJ)) + Environment.NewLine;
                        }
                        else if ((pi.GetValue(OldOBJ).ToString() != pi.GetValue(NewOBJ).ToString()))
                        {
                            changesetting += "" + pi.Name + " Old Value  " + pi.GetValue(OldOBJ).ToString() + " New Value " + pi.GetValue(NewOBJ).ToString() + Environment.NewLine;
                        }

                    }
                }
            }
            catch (Exception)
            {

                // throw;
            }

            return changesetting;
        }
