        //Added By Dharmendra on Nov-15-08 to set Transaction & PinPad numerals
        private void SetPinPadNumerals()
        {
            bool isConvert = true;
            int convertedValue = 0;
            isConvert = Int32.TryParse(oPOSSet.PinPadBaudRate, out convertedValue);

            if (isConvert.Equals(true) && convertedValue >= 1200)
            {
                this.txtBaudRate.Text = oPOSSet.PinPadBaudRate;
            }

            isConvert = Int32.TryParse(oPOSSet.PinPadPortNo, out convertedValue);
            if (isConvert.Equals(true) && convertedValue >= 0)// Modified By Rohit Nair For WP Integration to use USB HID feature
            {
                this.txtPortNo.Text = oPOSSet.PinPadPortNo;
                if (!string.IsNullOrEmpty(oPOSSet.PinPadPortNo))
                {
                    if (oPOSSet.PinPadPortNo.Trim().Equals("0"))
                    {
                        chkUseUSB.Checked = true;
                    }
                }

            }
            isConvert = Int32.TryParse(oPOSSet.PinPadDataBits, out convertedValue);
            if (isConvert.Equals(true) && convertedValue >= 7)
            {
                this.txtDataBits.Text = oPOSSet.PinPadDataBits;
            }
            isConvert = Int32.TryParse(oPOSSet.HeartBeatTime, out convertedValue);
            if (isConvert.Equals(true) && convertedValue >= 10)
            {
                this.txtHeartBeat.Text = oPOSSet.HeartBeatTime;
            }
            isConvert = Int32.TryParse(oPOSSet.TxnTimeOut, out convertedValue);
            if (isConvert.Equals(true) && convertedValue >= 30)
            {
                this.txtTxnTimeout.Text = oPOSSet.TxnTimeOut;
            }
        }

