        private void txtInitializeConTimer_Validating(object sender, CancelEventArgs e)
        {
            if (txtInitializeConTimer.Text.Trim().Length == 0)
            {
                ShowTimerErrorMessage("Connection Timer", true, Configuration.PRIMEPOCONNECTIONTIMERVALUE.ToString().Trim());

                txtInitializeConTimer.Focus();
                return;
            }
            else if (CheckTimerValues(txtInitializeConTimer.Text.Trim(), Configuration.PRIMEPOCONNECTIONTIMERVALUE) == false)
            {
                ShowTimerErrorMessage("Connection Timer", false, Configuration.PRIMEPOCONNECTIONTIMERVALUE.ToString().Trim());
                txtInitializeConTimer.Focus();
                return;
            }
        }

