        private bool CheckTimerValues(string timerValue, int minValue)
        {
            bool isValue = true;
            int newTimerValue = 0;
            isValue = Int32.TryParse(timerValue, out newTimerValue);
            if (isValue == true && (newTimerValue == 0 || newTimerValue < minValue))
                isValue = false;

            return isValue;
        }

        private void ShowTimerErrorMessage(string timerName, bool isLengthZero, string minimumTimerValue)
        {
            if (isLengthZero == true)
                clsUIHelper.ShowErrorMsg(timerName + " value is required. Minimum " + minimumTimerValue);
            else
                clsUIHelper.ShowErrorMsg("Invalid value assigned in " + timerName + " . The minimum required value is " + minimumTimerValue);
        }

        private void btnReset_Click(object sender, EventArgs e)
        {
            Item item = null;
            ItemVendor itemVendor = null;
            ItemData itemData = null;
            ItemVendorData itemVendorData = null;
            VendorData vendorData = null;
            VendorSvr vendorSvr = null;
            DataRow[] itemDataRow = null;
            string vendorID = string.Empty;
            string vendorCode = string.Empty;
            string priceQualifier = string.Empty;
            string costQualifier = string.Empty;
            int perCount = 0;
            int itemUpdated = 0;
            try
            {
                //Rewrite The logic By Shitaljit.

                if (this.ultraCmbDefaultVendors.Text != "")
                {
                    vendorID = this.ultraCmbDefaultVendors.SelectedItem.DataValue.ToString();
                    vendorCode = this.ultraCmbDefaultVendors.Text;
                    itemVendor = new ItemVendor();
                    vendorData = new VendorData();
                    vendorSvr = new VendorSvr();
                    item = new Item();
                    itemData = item.PopulateList(" where Item.ItemID in (select ItemVendor.ItemID from ItemVendor where ItemVendor.VendorID='" + vendorID + "')");
                    itemVendorData = itemVendor.PopulateList(" and ItemVendor.VendorID='" + vendorID + "' and ItemVendor.ItemID in (select Item.ItemID from Item)");

                    vendorData = vendorSvr.Populate(vendorCode);
                    if (Configuration.CPrimeEDISetting.DefaultVendor == vendorData.Vendor[0]["VendorCode"].ToString())  //PRIMEPOS-3167 07-Nov-2022 JY Modified
                    {
                        for (int count = 0; count < itemVendorData.ItemVendor.Rows.Count; count++)
                        {
                            ItemData oneItemData = new ItemData();
                            itemDataRow = itemData.Item.Select("ItemID = '" + itemVendorData.ItemVendor[count].ItemID + "'");
                            oneItemData.Item.Rows.Add(itemDataRow[0].ItemArray);
                            if (Configuration.CPrimeEDISetting.UpdateVendorPrice == true)    //PRIMEPOS-3167 07-Nov-2022 JY Modified
                            {
                                if ((bool)(vendorData.Vendor[0][clsPOSDBConstants.Vendor_Fld_UpdatePrice]) == true)
                                {
                                    if ((bool)(itemDataRow[0][clsPOSDBConstants.Item_Fld_UpdatePrice]) == true)
                                    {
                                        priceQualifier = vendorData.Vendor[0][clsPOSDBConstants.Vendor_Fld_PriceQualifier].ToString();
                                        //oneItemData.Item[0][clsPOSDBConstants.Item_Fld_SellingPrice] = GetPrice(itemVendorData.ItemVendor[count], priceQualifier);    //Sprint-21 - 2208 28-Jul-2015 JY Commented

                                        #region Sprint-21 - 2208 28-Jul-2015 JY Added logic to do not reduce selling price
                                        if ((bool)(vendorData.Vendor[0][clsPOSDBConstants.Vendor_Fld_ReduceSellingPrice]) == false)
                                        {
                                            decimal PriceRcvd = GetPrice(itemVendorData.ItemVendor[count], priceQualifier);
                                            if (Configuration.convertNullToDecimal(oneItemData.Item[0][clsPOSDBConstants.Item_Fld_SellingPrice]) < PriceRcvd)
                                                oneItemData.Item[0][clsPOSDBConstants.Item_Fld_SellingPrice] = PriceRcvd;
                                        }
                                        else
                                            oneItemData.Item[0][clsPOSDBConstants.Item_Fld_SellingPrice] = GetPrice(itemVendorData.ItemVendor[count], priceQualifier);
                                        #endregion
                                    }
                                }
                            }
                            costQualifier = vendorData.Vendor[0][clsPOSDBConstants.Vendor_Fld_CostQualifier].ToString();
                            oneItemData.Item[0][clsPOSDBConstants.Item_Fld_AvgPrice] = GetPrice(itemVendorData.ItemVendor[count], costQualifier);
                            oneItemData.Item[0].AcceptChanges();
                            oneItemData.Item[0].SetModified();
                            item.Persist(oneItemData);
                            Decimal dec = Decimal.Add(perCount, 1);
                            Decimal val = Decimal.Divide(dec, itemVendorData.ItemVendor.Rows.Count) * 100;

                            Application.DoEvents();
                            ClsUpdatePOStatus.GetMessage = " Update Price " + Convert.ToInt32(val) + " % ";
                            ClsUpdatePOStatus.UpdateStatusInst.UpdatePOCount();
                            perCount++;
                            itemUpdated++;
                        }
                        ClsUpdatePOStatus.GetMessage = "Reset Prices with Preferred Vendor " + this.ultraCmbDefaultVendors.Text;
                        ClsUpdatePOStatus.UpdateStatusInst.FillLogDataSet("ItemUpdated for Preferred Vendor=" + itemUpdated.ToString() + "");
                        ClsUpdatePOStatus.UpdateStatusInst.UpdatePOCount();
                    }
                }
                else
                {
                    clsUIHelper.ShowErrorMsg("Please set your default vendor.");
                    this.ultraCmbDefaultVendors.Focus();
                }
            }
            catch (Exception ex)
            {
                clsUIHelper.ShowErrorMsg(ex.Message);
            }
        }

        private Decimal GetPrice(POS_Core.CommonData.Rows.ItemVendorRow itemVendorDataRow, string priceQualifier)
        {
            Decimal price = Convert.ToDecimal(0.00);

            try
            {
                switch (priceQualifier)
                {
                    case clsPOSDBConstants.AWP:
                        price = itemVendorDataRow.AverageWholeSalePrice;
                        break;
                    case clsPOSDBConstants.CAT:
                        price = itemVendorDataRow.CatalogPrice;
                        break;
                    case clsPOSDBConstants.CON:
                        price = itemVendorDataRow.ContractPrice;
                        break;
                    case clsPOSDBConstants.DAP:
                        price = itemVendorDataRow.DealerAdjustedPrice;
                        break;
                    case clsPOSDBConstants.FUL:
                        price = itemVendorDataRow.FedrelUpperLimitPrice;
                        break;
                    case clsPOSDBConstants.MSR:
                        price = itemVendorDataRow.ManufacturerSuggPrice;
                        break;
                    case clsPOSDBConstants.NET:
                        price = itemVendorDataRow.NetItemPrice;
                        break;
                    case clsPOSDBConstants.PRO:
                        price = itemVendorDataRow.ProducersPrice;
                        break;
                    case clsPOSDBConstants.RES:
                        price = itemVendorDataRow.RetailPrice;
                        break;
                    //Added By Shitaljit on 5 Sept 2012
                    case clsPOSDBConstants.INV:
                        price = itemVendorDataRow.InVoiceBillingPrice;
                        break;
                    case "":
                        price = Convert.ToDecimal(0.00);
                        break;
                }
                return price;
            }
            catch (Exception ex)
            {
                ErrorHandler.logException(ex, "", "");
                return price;
            }
        }

