        private void FillDiscountKeyGrid()
        {
            Prefrences pre = new Prefrences();

            dtDiscountKey = pre.PopulateGetDiscount(Configuration.StationID);

            DataRow drKey;
            drKey = dtDiscountKey.Tables[0].Rows[0];

            dtGridDisCount.ColumnCount = 2;
            dtGridDisCount.Rows.Add(5);

            dtGridDisCount.Columns[0].HeaderText = "Key";
            dtGridDisCount.Columns[1].HeaderText = "%";

            dtGridDisCount.Columns[0].ReadOnly = true;

            dtGridDisCount[0, 0].Value = "A";
            dtGridDisCount[0, 1].Value = "B";
            dtGridDisCount[0, 2].Value = "C";
            dtGridDisCount[0, 3].Value = "D";
            dtGridDisCount[0, 4].Value = "E";

            dtGridDisCount[1, 0].Value = drKey["KeyA"];
            dtGridDisCount[1, 1].Value = drKey["KeyB"];
            dtGridDisCount[1, 2].Value = drKey["KeyC"];
            dtGridDisCount[1, 3].Value = drKey["KeyD"];
            dtGridDisCount[1, 4].Value = drKey["KeyE"];

            dtGridDisCount.Columns[1].DefaultCellStyle.Format = "###.00";
        }

        private void dtGridDisCount_CellEndEdit(object sender, DataGridViewCellEventArgs e)
        {
            string Pattern = "^\\d*\\.?((25)|(50)|(5)|(75)|(0)|(00))?$";
            string Tempvalue = Convert.ToString(dtGridDisCount[1, e.RowIndex].Value);

            if (Tempvalue == "")
            {
                Tempvalue = "0";
                dtGridDisCount[1, e.RowIndex].Value = 00;
            }

            if (!Regex.IsMatch(Tempvalue, Pattern))
            {
                MessageBox.Show("Please Enter Number Greater than equal to 0 and less than 100");
                dtGridDisCount[1, e.RowIndex].Value = DefaultColumnValue;
            }
            else if (Convert.ToDecimal(Tempvalue) < 00 || Convert.ToDecimal(Tempvalue) >= 100)
            {
                MessageBox.Show("Please Enter Number Greater than equal to 0 and less than 100");
                dtGridDisCount[1, e.RowIndex].Value = DefaultColumnValue;
            }
        }

