            oCustomerLoyaltyInfo.ProgramName = txtCLProgramName.Text;
            oCustomerLoyaltyInfo.CardRangeFrom = Configuration.convertNullToInt64(numCLCardRangeFrom.Value);
            oCustomerLoyaltyInfo.CardRangeTo = Configuration.convertNullToInt64(numCLCardRangeTo.Value);
            oCustomerLoyaltyInfo.DefaultCardExpiryDays = Configuration.convertNullToInt(txtCLDefaultCardExpiryDays.Value.ToString());
            oCustomerLoyaltyInfo.UseCustomerLoyalty = chkUseCustomerLoyalityProgram.Checked;

            oCustomerLoyaltyInfo.ExcludeDepts = ctrlExcludeDataDepts.GetData();
            oCustomerLoyaltyInfo.ExcludeClCouponDepts = ctrlExcludeDataDepts.GetSelectedData();
            List<String> excludeDeptDeleted = ctrlExcludeDataDepts.GetDeletedData();

            oCustomerLoyaltyInfo.ExcludeItems = ctrlExcludeDataItems.GetData();
            oCustomerLoyaltyInfo.ExcludeClCouponItems = ctrlExcludeDataItems.GetSelectedData();
            List<String> excludeItemDeleted = ctrlExcludeDataItems.GetDeletedData();

            oCustomerLoyaltyInfo.ExcludeSubDepts = ctrlExcludeDataSubDepts.GetData();
            oCustomerLoyaltyInfo.ExcludeClCouponSubDepts = ctrlExcludeDataSubDepts.GetSelectedData();
            List<String> excludeSubDeptDeleted = ctrlExcludeDataSubDepts.GetDeletedData();

            oCustomerLoyaltyInfo.ExcludeItemsOnSale = chkCLExcludeItemsOnSale.Checked;
            oCustomerLoyaltyInfo.Message = txtCLMessage.Text;
            oCustomerLoyaltyInfo.PrintMsgOnReceipt = chkCLPrintMsgOnReceipt.Checked;
            oCustomerLoyaltyInfo.RedeemValue = Configuration.convertNullToDecimal(txtCLRedeemValue.Value);
            oCustomerLoyaltyInfo.RedeemMethod = Configuration.convertNullToInt(cboRedeemMethod.Value);
            oCustomerLoyaltyInfo.ShowDiscountAppliedMsg = chkCLPShowMsgWhenDiscApplied.Checked;
            oCustomerLoyaltyInfo.IsTierValueInPercent = chkCLIsTierValueInPercent.Checked;
            oCustomerLoyaltyInfo.AllowMultipleCouponsInTrans = chkCLAllowMultipleCouponsInTrans.Checked;
            oCustomerLoyaltyInfo.ShowCLCardInputOnTrans = chkCLShowCLCardInputOnTrans.Checked;

            oCustomerLoyaltyInfo.IncludeRXItems = chkCLRXItemsOnly.Checked;
            oCustomerLoyaltyInfo.IncludeOTCItems = chkCLIncludeOTCItems.Checked;

            oCustomerLoyaltyInfo.IncludeItemsWithType = String.Empty;

            if (oCustomerLoyaltyInfo.IncludeRXItems == true)
            {
                if (oCustomerLoyaltyInfo.IncludeItemsWithType.Length > 0) oCustomerLoyaltyInfo.IncludeItemsWithType += ",";
                oCustomerLoyaltyInfo.IncludeItemsWithType += "R";
            }
            if (oCustomerLoyaltyInfo.IncludeOTCItems == true)
            {
                if (oCustomerLoyaltyInfo.IncludeItemsWithType.Length > 0) oCustomerLoyaltyInfo.IncludeItemsWithType += ",";
                oCustomerLoyaltyInfo.IncludeItemsWithType += "T";
            }

            oCustomerLoyaltyInfo.PointsCalcMethod = cboCLPointsCalcMethod.Value.ToString();
