        private string GetDeptNames(string codes)
        {
            string returnValue = "";
            try
            {
                POS_Core.BusinessRules.Department oDept = new Department();
                DepartmentData oDeptData;
                oDeptData = oDept.PopulateList(" and deptid in (" + codes + ")");

                foreach (POS_Core.CommonData.Rows.DepartmentRow oRow in oDeptData.Department.Rows)
                {
                    returnValue += "," + oRow.DeptName;
                }

                if (returnValue.StartsWith(","))
                {
                    returnValue = returnValue.Substring(1);
                }
            }
            catch (Exception exp)
            {
                returnValue = "";
            }
            return returnValue;
        }

