        //Added By Shitaljit for JIRA 385
        //Allow to ring up taxable NON taxable item.
        /// <summary>
        /// To search and assign Item for default taxable and no txable
        /// </summary>
        /// <param name="sender"></param>
        private void SearchItem(string sender)
        {
            try
            {
                //frmSearch oSearch = new frmSearch(clsPOSDBConstants.Item_tbl, "", "TaxID", "1");
                frmSearchMain oSearch = new frmSearchMain(clsPOSDBConstants.Item_tbl, "", "TaxID", "1", true);  //20-Dec-2017 JY Added new reference
                oSearch.ShowDialog(this);
                if (!oSearch.IsCanceled)
                {
                    string strCode = oSearch.SelectedRowID();
                    if (string.IsNullOrEmpty(strCode) == false)
                    {
                        POS_Core.BusinessRules.Item oItem = new Item();
                        ItemData oItemData;
                        ItemRow oItemRow = null;
                        oItemData = oItem.Populate(strCode);
                        oItemRow = oItemData.Item[0];
                        if (oItemRow != null)
                        {
                            strCode = oItemRow.ItemID;
                            if (sender.Equals("T") && oItemRow.isTaxable == true && oItemRow.TaxID != 0)
                            {
                                this.txtDefTaxableItem.Text = oCInfo.DefaultTaxableItem = strCode;
                                return;
                            }
                            else if (sender.Equals("T"))
                            {
                                throw new Exception("Item# " + strCode + " is a non-taxable item, plese select a taxable item.");
                            }
                            if (sender.Equals("NT") && oItemRow.isTaxable == false)
                            {
                                this.txtDefNonTaxableItem.Text = oCInfo.DefaultNonTaxableItem = strCode;
                                return;
                            }
                            else if (sender.Equals("NT"))
                            {
                                throw new Exception("Item# " + strCode + " is a taxable item, plese select a non-taxable item.");
                            }
                        }
                    }
                }
                else
                {
                    if (sender.Equals("T"))
                    {
                        this.txtDefTaxableItem.Text = "";
                    }
                    else
                    {
                        this.txtDefNonTaxableItem.Text = "";
                    }
                }
            }
            catch (Exception exp)
            {
                clsUIHelper.ShowErrorMsg(exp.Message);
                SearchItem(sender);
            }
        }

