        private void txtTomail_Leave(object sender, EventArgs e)
        {
            if (this.txtOutgoingEmailID.Text.Trim().Length > 0 && !RgxValidateEmailID.IsMatch(this.txtOutgoingEmailID.Text.Trim()))
            {
                clsUIHelper.ShowErrorMsg("Invalid in Outgoing Email ID");
            }
            else if (this.txtTomail.Text.Trim().Length > 0)
            {
                string words = this.txtTomail.Text.Trim();
                string[] split = words.Split(new Char[] { ',', ';' });
                foreach (string item in split)
                {
                    if (!RgxValidateEmailID.IsMatch(item))
                        clsUIHelper.ShowErrorMsg("Invalid in To Email ");
                }
            }
        }

        private void btnSend_Click(object sender, EventArgs e)
        {
            try
            {
                if (this.txtTomail.Text.Trim().Length > 0)
                {
                    if (this.txtOutgoingEmailID.Text.Trim().Length > 0 && !RgxValidateEmailID.IsMatch(this.txtOutgoingEmailID.Text.Trim()))
                    {
                        clsUIHelper.ShowErrorMsg("Invalid EmailID in Outgoing Email ID");
                    }
                    else if (this.txtTomail.Text.Trim().Length > 0)
                    {
                        bool issend = true;
                        string words = this.txtTomail.Text.Trim();
                        string[] split = words.Split(new Char[] { ',', ';' });
                        foreach (string item in split)
                        {
                            if (!RgxValidateEmailID.IsMatch(item))
                            {
                                clsUIHelper.ShowErrorMsg("Invalid in To Email ");
                                issend = false;
                            }
                        }
                        if (issend)
                        {
                            TransHeaderSvr oTHSvr = new TransHeaderSvr();

                            int maxtranceid = oTHSvr.GetMaxTransId() - 1;
                            frmSendEmail tempObj = new frmSendEmail(maxtranceid);
                            if (maxtranceid > 0)
                            {
                                //rptPrintTransaction oRptPrintTrancsaction = tempObj.CreateTransReceiptForEmail(maxtranceid);

                                if (EmailTestMail(null, "", this.txtTomail.Text.Trim(), tempObj.EmailSubject, this.txtOutgoingEmailBody.Text.Trim(), "INV" + "1"))
                                    clsUIHelper.ShowSuccessMsg("Test Email Sent successfully", "Email Sent Successfully");
                                this.txtTomail.Text = "";
                            }
                            else
                            {
                                if (EmailTestMail(null, "", this.txtTomail.Text.Trim(), tempObj.EmailSubject, this.txtOutgoingEmailBody.Text.Trim(), "INV" + "1"))
                                    clsUIHelper.ShowSuccessMsg("Test Email Sent successfully", "Email Sent Successfully");
                                this.txtTomail.Text = "";
                            }
                        }
                    }
                }
                else
                {
                    clsUIHelper.ShowErrorMsg("Please enter EmailID in To Email ");
                    this.txtTomail.Focus();
                    this.txtTomail.Text = "";
                }
            }
            catch (Exception ex)
            {
                clsUIHelper.ShowErrorMsg("Unable to Send email" + ex.Message);
            }
        }

        private bool EmailTestMail(ReportClass reportName, string CustName, string toMail, string subject, string body, string fileName)
        {
            //public static bool sendImvoiceMAil(string CustName,string toMail, string trancID, DateTime trancedate)
            //LogData.
            try
            {
                this.Cursor = Cursors.WaitCursor;

                Regex expression = new Regex(@"\A(?:[a-z0-9!#$%&'*+/=?^_`{|}~-]+(?:\.[a-z0-9!#$%&'*+/=?^_`{|}~-]+)*@(?:[a-z0-9](?:[a-z0-9-]*[a-z0-9])?\.)+[a-z0-9](?:[a-z0-9-]*[a-z0-9])?)\Z");
                string words = toMail;

                string[] split = words.Split(new Char[] { ',', ';' });
                //Regex expression = new Regex(@"\w+@[a-zA-Z_]+?\.[a-zA-Z]{2,3}");
                MailMessage mail = new MailMessage();
                SmtpClient SmtpServer = new SmtpClient(this.txtOutgoingEmailServer.Text.Trim());

                if (expression.IsMatch(this.txtOutgoingEmailID.Text.Trim()))
                    mail.From = new MailAddress(this.txtOutgoingEmailID.Text.Trim());
                else
                {
                    clsUIHelper.ShowErrorMsg("Invalid Email Format in outgoing Email Id");
                    return false;
                }
                foreach (string emailString in split)
                {

                    if (expression.IsMatch(emailString))
                    {
                        mail.To.Add(emailString);
                    }
                    else
                    {
                        clsUIHelper.ShowErrorMsg("Invalid Email Format in To mail");
                        return false;
                    }
                }
                if (Configuration.convertNullToInt(this.txtOutgoingEmailPort.Text.Trim()) > 0)
                {
                    SmtpServer.Port = Configuration.convertNullToInt(this.txtOutgoingEmailPort.Text.Trim());
                }
                else
                {
                    SmtpServer.Port = 587;
                }

                SmtpServer.EnableSsl = this.ChkOutgoingEmailEnableSSL.Checked;
                SmtpServer.Credentials = new System.Net.NetworkCredential(this.txtOutgoingEmailUserID.Text.Trim(), this.txtOutgoingEmailPass.Text.Trim());

                StringBuilder mailBody = new StringBuilder();

                mailBody.AppendFormat("<br> Dear " + CustName + "<br />");
                mailBody.AppendFormat("<p>" + body + "</p>");
                mailBody.AppendFormat("" + this.txtOutgoingEmailSignature.Text.Trim() + "");

                mail.Subject = subject;//"Invoice:" + trancID + ",Purchase Date:" + trancedate;
                string htmlBody = mailBody.ToString();
                mail.Body = htmlBody;
                mail.IsBodyHtml = true;
                if (reportName != null)
                {
                    //mail.Attachments.Add(new Attachment(reportName.ExportToStream(ExportFormatType.PortableDocFormat), "TestINVOICE" + ".pdf"));
                }
                // mail.Attachments.Add(attachment);



                SmtpServer.Send(mail);
                this.Cursor = Cursors.Default;
                return true;
            }
            catch (Exception ex)
            {
                this.Cursor = Cursors.Default;
                clsUIHelper.ShowErrorMsg("Unable to Send Email, please check email settings " + Environment.NewLine + ex.Message);
                return false;
            }


        }

