        private void FillMessageFormatCombos()
        {
            Prefrences oPrefrences = new Prefrences();

            cboSPEmailFormat.Items.Clear();
            cboSPEmailFormat.DisplayMember = "MessageCode";
            cboSPEmailFormat.ValueMember = "RecID";
            cboSPEmailFormat.DataSource = oPrefrences.getMessageFormat((int)eMessageCategory.StoredProfiles, (int)eMessaging.Email).Copy();
        }

        private void messageFormat_LinkClicked(object sender, LinkLabelLinkClickedEventArgs e)
        {
            int iCategory = -1;
            int iType = -1;
            int RecID = 0;
            bool isNewRecord = false;
            if (sender == null)
                return;
            LinkLabel lnkLabel = (LinkLabel)sender;
            if (lnkLabel.Tag == null)
                return;

            switch (lnkLabel.Tag.ToString())
            {
                case "SP-Add-Email":
                    iCategory = (int)eMessageCategory.StoredProfiles;
                    iType = (int)eMessaging.Email;
                    isNewRecord = true;
                    break;
                case "SP-Edit-Email":
                    RecID = cboSPEmailFormat.Value == null ? 0 : Configuration.convertNullToInt(cboSPEmailFormat.Value);
                    iCategory = (int)eMessageCategory.StoredProfiles;
                    iType = (int)eMessaging.Email;
                    isNewRecord = false;
                    break;
                default:
                    break;
            }

            frmMsgTemplate ofrmMsgTemplate = new frmMsgTemplate();
            if (isNewRecord)
            {
                ofrmMsgTemplate.MessageCategoryId = iCategory;
                ofrmMsgTemplate.MessageTypeId = iType;
            }
            else
            {
                ofrmMsgTemplate.MessageCategoryId = iCategory;
                ofrmMsgTemplate.MessageTypeId = iType;
                bool bStatus = ofrmMsgTemplate.Edit(RecID);
                if (!bStatus) return;
            }
            ofrmMsgTemplate.ShowDialog();
            if (isNewRecord && ofrmMsgTemplate.AddStatus)
            {
                FillMessageFormatCombos();
                if (Configuration.convertNullToInt(oCInfo.SPEmailFormatId) != 0)
                    this.cboSPEmailFormat.Value = oCInfo.SPEmailFormatId;
                else
                    this.cboSPEmailFormat.SelectedIndex = 0;
            }
        }

