        private bool IsDirectoryExistAndWritable(string dirPath)
        {
            bool bStatus = false;
            try
            {
                if (Directory.Exists(dirPath))
                {
                    using (FileStream fs = File.Create(Path.Combine(dirPath, Path.GetRandomFileName()), 1, FileOptions.DeleteOnClose))
                    {
                        bStatus = true;
                    }
                }
            }
            catch (Exception ex)
            {
                bStatus = false;
            }
            return bStatus;
        }
