        private void GetS3FileLastUpdatedDate()
        {
            try
            {
                Dictionary<string, string> getsett = Configuration.getSettingDetail();
                if (getsett.ContainsKey(clsPOSDBConstants.SettingDetail_S3LastUploadDateOnFTP))
                {
                    try
                    {
                        lblLastFileUploadDate.Text = "Last file upload date : " + Convert.ToDateTime(getsett[clsPOSDBConstants.SettingDetail_S3LastUploadDateOnFTP]).ToString("MM/dd/yyyy");
                    }
                    catch
                    {
                        lblLastFileUploadDate.Text = "Last file upload date : " + Convert.ToDateTime("1900-01-01 00:00:00").ToString();
                    }
                }
                else
                {
                    lblLastFileUploadDate.Text = "";
                    string strSQL = "UPDATE SettingDetail SET FieldValue = '' WHERE FieldName = " + clsPOSDBConstants.SettingDetail_S3LastUploadDateOnFTP;
                    DataHelper.ExecuteNonQuery(Configuration.ConnectionString, CommandType.Text, strSQL);
                }

                if (getsett.ContainsKey(clsPOSDBConstants.SettingDetail_S3FileName))
                    txtS3FileName.Text = Configuration.convertNullToString(getsett[clsPOSDBConstants.SettingDetail_S3FileName]);
                else
                    txtS3FileName.Text = "";
            }
            catch (Exception Ex)
            {
                Logs.Logger("frmPrefrences", "GetS3FileLastUpdatedDate()", clsPOSDBConstants.Log_Exception_Occured + Ex.Message + Ex.StackTrace.ToString());
            }
        }
