        private bool GetShopApi(string mmsKey, string retailerKey)
        {
            //PRIMEPOS-2875
            var jsonString = "";
            var result = "";
            bool success = false;
            try
            {
                GetShopInfoJson getShopinfo = new GetShopInfoJson();
                getShopinfo.retailer_auth_key = retailerKey;// "g9piGWxWp8qI8QjX";//this.txtPointyRetailerKey.Value.ToString();
                getShopinfo.client_auth_key = mmsKey;// "6ft5lfXXhm5xIZ3cB3k63F9ho3x3HbMw";//this.txtPointyMMSKey.Value.ToString();
                jsonString = JsonConvert.SerializeObject(getShopinfo);
                Logs.Logger("Pointy -->GetShopApi():Request Json data:" + jsonString);
                //ServicePointManager.SecurityProtocol = SecurityProtocolType.Tls | SecurityProtocolType.Tls11 | SecurityProtocolType.Tls12 | SecurityProtocolType.Ssl3;  //PRIMEPOS-3067 09-Mar-2022 JY Added  //PRIMEPOS-3179 27-Jan-2023 JY Commented
                using (var client = new HttpClient())
                {
                    client.BaseAddress = new Uri(PointyUrl + getShopEndpoint);

                    var response = client.PostAsync(client.BaseAddress, new StringContent(jsonString.ToString(), Encoding.UTF8, "application/json")).Result;

                    if (response != null)
                    {
                        using (HttpContent content = response.Content)
                        {
                            // ... Read the string.
                            Task<string> res = content.ReadAsStringAsync();
                            string respons = res.Result;
                            Logs.Logger("Pointy -->GetShopApi():Response:" + respons);
                            if (respons != "" || respons != null)
                            {
                                if (respons.ToLower().Contains("client_access_denied"))
                                {
                                    clsUIHelper.ShowErrorMsg("Client access is denied!Please contact support team for assistance.\r\nEmail: support@micromerchantsystems.com \r\nPhone: (516) 408-3999 or (866) 495-3999");
                                    success = false;
                                }
                                else if (respons.ToLower().Contains("retailer_access_denied"))
                                {
                                    clsUIHelper.ShowErrorMsg("Retailer access is denied!");
                                    success = false;
                                }
                                else if (respons.ToLower().Contains("retailer_shop_deleted"))
                                {
                                    clsUIHelper.ShowErrorMsg("Location has been deleted from Pointy!");
                                    success = false;
                                }
                                else if (respons.ToLower().Contains("retailer_access_expired"))
                                {
                                    clsUIHelper.ShowErrorMsg("Retailer Key Expired!");
                                    success = false;
                                }
                                else if (respons.ToLower().Contains("ok"))
                                {
                                    result = response.Content.ReadAsStringAsync().Result;
                                    DisplayShopApiResponse(result);
                                    btnMondaySwitch.Visible = false;
                                    btnTuesdaySwitch.Visible = false;
                                    btnWednesdaySwitch.Visible = false;
                                    btnThursdaySwitch.Visible = false;
                                    btnFridaySwitch.Visible = false;
                                    btnSaturdaySwitch.Visible = false;
                                    btnSundaySwitch.Visible = false;
                                    success = true;

                                }

                            }

                        }
                    }
                    else
                    {
                        clsUIHelper.ShowErrorMsg("Store info not available!");
                        success = false;
                    }
                }
            }
            catch (Exception ex)
            {
                clsUIHelper.ShowErrorMsg("Error:" + ex.Message);
                Logs.Logger("GetShopApi()--Exception :" + ex.Message);
                success = false;

            }
            return success;
        }


