        public int CalculateTimeInMinutes(string input)
        {
            //PRIMEPOS-2875
            try
            {
                DateTime time = DateTime.Parse(input, new CultureInfo("en-US"));
                return (int)(time - time.Date).TotalMinutes;
            }
            catch (Exception)
            {
                throw;
            }
        }


