        private bool SendConformationMail(string custName, string toMail, string subject, string body)
        {
            ////PRIMEPOS-2875
            try
            {


                Regex expression = new Regex(@"\A(?:[a-z0-9!#$%&'*+/=?^_`{|}~-]+(?:\.[a-z0-9!#$%&'*+/=?^_`{|}~-]+)*@(?:[a-z0-9](?:[a-z0-9-]*[a-z0-9])?\.)+[a-z0-9](?:[a-z0-9-]*[a-z0-9])?)\Z");
                string words = toMail;

                string[] split = words.Split(new Char[] { ',', ';' });

                MailMessage mail = new MailMessage();
                SmtpClient SmtpServer = new SmtpClient(oSetting.MMSEmailServer);

                if (expression.IsMatch(MMSEmailID))
                {
                    mail.From = new MailAddress(MMSEmailID);
                }
                else
                {
                    //  clsUIHelper.ShowErrorMsg("Invalid Email Format OutGoingEmailID");
                    return false;
                }
                foreach (string emailString in split)
                {

                    if (expression.IsMatch(emailString))
                    {
                        mail.To.Add(emailString);
                    }
                    else
                    {
                        //  clsUIHelper.ShowErrorMsg("Invalid Email Format");
                        return false;
                    }
                }

                SmtpServer.Port = oSetting.MMSEmailPort;
                SmtpServer.EnableSsl = oSetting.EnableSSL;
                SmtpServer.UseDefaultCredentials = false;
                SmtpServer.Credentials = new System.Net.NetworkCredential(MMSEmailID, MMSEmailPass);

                StringBuilder mailBody = new StringBuilder();

                mailBody.AppendFormat("<br> Dear " + custName + "<br />");
                mailBody.AppendFormat("<p>" + body + "</p>");
                mailBody.AppendFormat("" + oSetting.MMSEmailSig + "");

                mail.Subject = subject;
                string htmlBody = mailBody.ToString();
                mail.Body = htmlBody;
                mail.IsBodyHtml = true;



                SmtpServer.Send(mail);
                Logs.Logger("SendConformationMail():Email sent successfully tO" + toMail);
                // MessageBox.Show("Confirmation mail has been sent to your EmailId ! You can contact MMS team for further assistance.");
                return true;
            }
            catch (Exception ex)
            {
                Logs.Logger("SendConformationMail():Unable to send Email  successfully TO" + toMail + Environment.NewLine + ex.Message);
                // clsUIHelper.ShowErrorMsg("Unable to Send Email" + Environment.NewLine + ex.Message);
                return false;
            }


        }

