        #region PRIMEPOS-2996 21-Sep-2021 JY Added
        private void SetPaperSourceCombo(Infragistics.Win.UltraWinEditors.UltraComboEditor cboPaperSource, string printerName, string defPaperSource)
        {
            try
            {
                Application.DoEvents();
                this.Cursor = Cursors.WaitCursor;

                System.Drawing.Printing.PrintDocument mPd = new System.Drawing.Printing.PrintDocument();
                mPd.PrintController = new System.Drawing.Printing.StandardPrintController();

                mPd.PrinterSettings.PrinterName = printerName;
                cboPaperSource.Items.Clear();

                foreach (System.Drawing.Printing.PaperSource mp in mPd.PrinterSettings.PaperSources)
                {
                    cboPaperSource.Items.Add(mp.SourceName);
                }
                if (defPaperSource.Length > 0)
                {
                    int iIndex = -1;
                    iIndex = cboPaperSource.FindString(defPaperSource);
                    cboPaperSource.SelectedIndex = iIndex;
                }
                else
                    cboPaperSource.SelectedIndex = -1;
            }
            catch (Exception Ex)
            {
                logger.Fatal(Ex, "SetPaperSourceCombo()");
            }
            finally
            {
                this.Cursor = Cursors.Default;
            }
        }

