        private void cboPatientsSubCategories_TextChanged(object sender, EventArgs e)
        {
            string strDesc = GetPatientsSubCategories(cboPatientsSubCategories.CheckedItems);
            if (cboPatientsSubCategories.Text != strDesc)
                cboPatientsSubCategories.Text = strDesc;
            this.toolTip1.SetToolTip(this.cboPatientsSubCategories, cboPatientsSubCategories.Text);
        }

        private void cboPatientsSubCategories_AfterCloseUp(object sender, EventArgs e)
        {
            cboPatientsSubCategories.Text = GetPatientsSubCategories(cboPatientsSubCategories.CheckedItems);
            this.toolTip1.SetToolTip(this.cboPatientsSubCategories, cboPatientsSubCategories.Text);
        }

        private string GetPatientsSubCategories(Infragistics.Win.CheckedValueListItemsCollection checkedValueListItemsCollection)
        {
            string SubCats = string.Empty;
            try
            {
                foreach (var item in checkedValueListItemsCollection)
                {
                    if (SubCats == string.Empty)
                    {
                        SubCats = item.DisplayText.ToString().Trim();
                    }
                    else
                    {
                        SubCats += ", " + item.DisplayText.ToString().Trim();
                    }
                }
            }
            catch(Exception Ex)
            {
            }
            return SubCats;
        }

        private string GetSelectedPatientsSubCategories(Infragistics.Win.CheckedValueListItemsCollection checkedValueListItemsCollection)
        {
            string SubCategoryIds = string.Empty;

            foreach (var item in checkedValueListItemsCollection)
            {
                if (SubCategoryIds == string.Empty)
                {
                    SubCategoryIds = item.DataValue.ToString();
                }
                else
                {
                    SubCategoryIds += "," + item.DataValue.ToString();
                }
            }
            return SubCategoryIds;
        }

        private string SetPatientsSubCategories(string SubCategoryIds)
        {
            string[] SubCats = SubCategoryIds.Split(',');
            string strDesc = string.Empty, Ids = string.Empty;
            for (int i = 0; i < SubCats.Length; i++)
            {
                foreach (Infragistics.Win.ValueListItem item in cboPatientsSubCategories.Items)
                {
                    if (SubCats[i] == item.DataValue.ToString())
                    {
                        item.CheckState = CheckState.Checked;
                        if (strDesc == string.Empty)
                        {
                            strDesc = item.DisplayText.ToString().Trim();
                            Ids = SubCats[i];
                        }
                        else
                        {
                            strDesc = ", " + item.DisplayText.ToString().Trim();
                            Ids = "," + SubCats[i];
                        }
                        break;
                    }
                }
            }
            oSetting.PatientsSubCategories = Ids;
            return strDesc;
        }
        #endregion
